const Welcome = () => {
    return (
        <div className="welcome">
           <h1>Welcome</h1>
           <h3>This is demo project, files saved here are being stored on the database which can be seen by the admin</h3>
<h4>Kindly fill in your details correctly
    <br />
    Thank You!
</h4>
<button>Proceed</button>
        </div>
      );
}
 

export default Welcome;
